import React, { useEffect, useState } from 'react';

const Introduction = () => {
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    // Trigger animations on component mount
    setIsVisible(true);
  }, []);

  return (
    <div className="min-h-screen" style={{ backgroundColor: '#fff7ee' }}>
      <style jsx>{`
        .sideways-text {
          writing-mode: sideways-lr;
          position: absolute;
          left: 25px;
          bottom: 30%;
        }
        
        .font1 {
          font-family: 'Ibarra Real Nova', serif;
        }
        
        .fontcolor1 {
          color: #9c4819;
        }
        
        .fontcolor2 {
          color: #DDDDDD;
        }
        
        .fontsize1 {
          font-size: 300%;
        }
        
        .fontsize2 {
          font-size: 400%;
        }
        
        .overlap-image {
          transform: scale(1.3);
          position: relative;
          z-index: 10;
          margin-bottom: -100px;
          transition: transform 0.3s ease;
        }
        
        .overlap-image:hover {
          transform: scale(1.4);
        }
        
        .zoom-out-right {
          transform: ${isVisible ? 'translateX(0)' : 'translateX(-50px)'};
          opacity: ${isVisible ? '1' : '0'};
          transition: all 1s ease-out;
        }
        
        .flip-left {
          transform: ${isVisible ? 'rotateY(0deg)' : 'rotateY(-180deg)'};
          opacity: ${isVisible ? '1' : '0'};
          transition: all 2s ease-out;
        }
        
        @media only screen and (max-width: 767px) {
          .sideways-text {
            display: none;
          }
          
          .font1 {
            font-size: 16px;
          }
          
          .fontsize1 {
            font-size: 200%;
          }
          
          .fontsize2 {
            font-size: 300%;
          }
        }
      `}</style>
      
      <div className="container mx-auto px-4">
        {/* Navigation */}
        <nav className="fixed top-0 left-0 right-0 bg-white bg-opacity-90 backdrop-blur-sm z-50 p-4">
          <div className="container mx-auto">
            <div className="flex justify-end">
              <ul className="flex space-x-8 text-lg font-bold">
                <li>
                  <a 
                    href="#about_me" 
                    className="text-brown-700 hover:text-green-600 hover:italic transition-all duration-300 no-underline"
                    style={{ color: '#9c4819' }}
                  >
                    ABOUT ME
                  </a>
                </li>
                <li>
                  <a 
                    href="#education" 
                    className="text-brown-700 hover:text-green-600 hover:italic transition-all duration-300 no-underline"
                    style={{ color: '#9c4819' }}
                  >
                    EDUCATION
                  </a>
                </li>
                <li>
                  <a 
                    href="#expertise" 
                    className="text-brown-700 hover:text-green-600 hover:italic transition-all duration-300 no-underline"
                    style={{ color: '#9c4819' }}
                  >
                    EXPERTISE
                  </a>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        {/* Main Content */}
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8 pt-24">
          {/* Left Column - Text Content */}
          <div className="font1 relative">
            <div className="pt-16">
              <p 
                className={`text-left fontcolor1 fontsize1 zoom-out-right ${isVisible ? 'animate-in' : ''}`}
                style={{ 
                  color: '#9c4819',
                  fontSize: 'clamp(2rem, 8vw, 3rem)',
                  transitionDelay: '0.2s'
                }}
              >
                Hello,
              </p>
              <p 
                className={`text-left fontsize2 zoom-out-right ${isVisible ? 'animate-in' : ''}`}
                style={{ 
                  fontSize: 'clamp(2.5rem, 10vw, 4rem)',
                  transitionDelay: '0.4s'
                }}
              >
                <b>I'm Rainn</b>
              </p>
              <p 
                className={`text-left fontsize2 zoom-out-right ${isVisible ? 'animate-in' : ''}`}
                style={{ 
                  fontSize: 'clamp(2.5rem, 10vw, 4rem)',
                  transitionDelay: '0.6s'
                }}
              >
                <b>Abrogena!</b>
              </p>
              <p 
                className={`zoom-out-right ${isVisible ? 'animate-in' : ''}`}
                style={{ 
                  transitionDelay: '0.8s',
                  fontSize: '1.1rem',
                  lineHeight: '1.6'
                }}
              >
                A multimedia arts student at Mapua University. She is an aspiring digital illustrator committed to her creative crafts.
              </p>
            </div>
            
            {/* Info Image 1 */}
            <div className="mt-16 lg:mt-20">
              <img 
                src="/api/placeholder/400/300" 
                className={`rounded-lg w-full max-w-sm mx-auto flip-left ${isVisible ? 'animate-in' : ''}`}
                alt="Info 1"
                style={{ transitionDelay: '1s' }}
              />
            </div>
            
            {/* Sideways Text */}
            <h1 
              id="about_me" 
              className={`sideways-text text-left fontcolor2 font-bold zoom-out-right hidden lg:block ${isVisible ? 'animate-in' : ''}`}
              style={{ 
                color: '#DDDDDD',
                transitionDelay: '1.2s'
              }}
            >
              ABOUT ME
            </h1>
          </div>

          {/* Middle Column - Main Photo */}
          <div className="flex flex-col items-center">
            <img 
              src="/api/placeholder/400/500" 
              className={`rounded-lg w-full max-w-md flip-left ${isVisible ? 'animate-in' : ''}`}
              alt="Rainn Abrogena"
              style={{ transitionDelay: '0.5s' }}
            />
            
            {/* Info Image 2 */}
            <div className="mt-8">
              <img 
                src="/api/placeholder/300/200" 
                className={`rounded-lg w-full max-w-xs mx-auto flip-left ${isVisible ? 'animate-in' : ''}`}
                alt="Info 2"
                style={{ transitionDelay: '1.4s' }}
              />
            </div>
          </div>

          {/* Right Column - Decorative Images */}
          <div className="flex flex-col items-center justify-center space-y-8">
            <div className="mt-20 lg:mt-32">
              <img 
                src="/api/placeholder/250/300" 
                className={`rounded-lg overlap-image flip-left ${isVisible ? 'animate-in' : ''}`}
                alt="Leaf decoration"
                style={{ transitionDelay: '1.6s' }}
              />
            </div>
            
            <div className="mt-16">
              <img 
                src="/api/placeholder/280/200" 
                className={`rounded-lg overlap-image flip-left ${isVisible ? 'animate-in' : ''}`}
                alt="Communication design"
                style={{ transitionDelay: '1.8s' }}
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Introduction;
